/**
 * Map of comune name (uppercase) to AicsComune records
 * Multiple comuni can have the same name in different provinces
 */
const comuneByName = new Map<string, AicsComune[]>();

/**
 * Map of province code to array of comuni
 */
const comuniByProvincia = new Map<string, AicsComune[]>();

/**
 * Map of cadastral code to AicsComune
 */
const comuneByCatastale = new Map<string, AicsComune>();

// Initialize lookup maps
for (const comune of AICS_COMUNI) {
	// By name (uppercase for case-insensitive lookup)
	const nameKey = comune.comune.toUpperCase();
	if (!comuneByName.has(nameKey)) {
		comuneByName.set(nameKey, []);
	}
	comuneByName.get(nameKey)!.push(comune);

	// By provincia
	if (!comuniByProvincia.has(comune.provinciaCode)) {
		comuniByProvincia.set(comune.provinciaCode, []);
	}
	comuniByProvincia.get(comune.provinciaCode)!.push(comune);

	// By cadastral code
	comuneByCatastale.set(comune.codiceCatastale, comune);
}

