/**
 * Normalize a comune name for comparison
 * - Uppercase
 * - Remove accents
 * - Normalize whitespace
 */
export function normalizeComuneName(name: string): string {
	if (!name) return '';

	return name
		.toUpperCase()
		.normalize('NFD')
		.replace(/[\u0300-\u036f]/g, '') // Remove accent marks
		.replace(/[''']/g, "'") // Normalize apostrophes
		.replace(/\s+/g, ' ') // Normalize whitespace
		.trim();
}

/**
 * Find a comune by name, optionally filtering by provincia
 *
 * @param nome - The comune name to search for
 * @param provincia - Optional 2-letter province code to filter by
 * @returns The matching AicsComune or null if not found
 */
export function findComuneByName(
	nome: string,
	provincia?: string
): AicsComune | null {
	if (!nome) return null;

	const normalized = normalizeComuneName(nome);
	const matches = comuneByName.get(normalized);

	if (!matches || matches.length === 0) {
		// Try alternative search: without special characters
		const simpleNormalized = normalized.replace(/[^A-Z0-9 ]/g, '');
		for (const [key, comuni] of comuneByName.entries()) {
			const simpleKey = key.replace(/[^A-Z0-9 ]/g, '');
			if (simpleKey === simpleNormalized) {
				if (!provincia) return comuni[0];
				const filtered = comuni.filter(
					(c) => c.provinciaCode === provincia.toUpperCase()
				);
				if (filtered.length > 0) return filtered[0];
			}
		}

		// For foreign lookups, try alias resolution (common names and city‚Üícountry)
		if (provincia?.toUpperCase() === 'EE') {
			const alias = FOREIGN_COUNTRY_ALIASES[normalized];
			if (alias) {
				return findComuneByName(alias, 'EE');
			}
		}

		return null;
	}

	if (!provincia) {
		return matches[0];
	}

	const provinciaUpper = provincia.toUpperCase();
	const filtered = matches.filter((c) => c.provinciaCode === provinciaUpper);
	if (filtered.length > 0) return filtered[0];

	// If the name matched but not for EE province, try alias resolution
	if (provinciaUpper === 'EE') {
		const alias = FOREIGN_COUNTRY_ALIASES[normalized];
		if (alias) {
			return findComuneByName(alias, 'EE');
		}
	}

	return null;
}

/**
 * Check if a comune name is valid for a given provincia in AICS system
 *
 * @param nome - The comune name to validate
 * @param provincia - The 2-letter province code
 * @returns true if the comune exists in AICS for the given provincia
 */
export function isValidComuneAICS(nome: string, provincia: string): boolean {
	if (!nome || !provincia) return false;

	// EE = foreign, always valid
	if (provincia.toUpperCase() === 'EE') return true;

	return findComuneByName(nome, provincia) !== null;
}

/**
 * Get all comuni for a given provincia
 *
 * @param provincia - The 2-letter province code
 * @returns Array of AicsComune records for the provincia
 */
export function getComuniByProvincia(provincia: string): AicsComune[] {
	if (!provincia) return [];
	return comuniByProvincia.get(provincia.toUpperCase()) || [];
}

/**
 * Find a comune by its cadastral code
 *
 * @param codiceCatastale - The cadastral code (e.g., "F205")
 * @returns The matching AicsComune or null if not found
 */
export function findComuneByCatastale(
	codiceCatastale: string
): AicsComune | null {
	if (!codiceCatastale) return null;
	return comuneByCatastale.get(codiceCatastale.toUpperCase()) || null;
}

/**
 * Get the official AICS comune name for a given input
 * Useful for normalizing user input to match AICS format
 *
 * @param nome - The comune name to normalize
 * @param provincia - Optional province code for disambiguation
 * @returns The official AICS comune name or null if not found
 */
export function getOfficialComuneName(
	nome: string,
	provincia?: string
): string | null {
	const comune = findComuneByName(nome, provincia);
	return comune ? comune.comune : null;
}

/**
 * Search for comuni matching a partial name
 * Useful for autocomplete functionality
 *
 * @param partialName - Partial name to search for
 * @param provincia - Optional province code to filter by
 * @param limit - Maximum results to return (default 10)
 * @returns Array of matching AicsComune records
 */
export function searchComuni(
	partialName: string,
	provincia?: string,
	limit: number = 10
): AicsComune[] {
	if (!partialName || partialName.length < 2) return [];

	const normalized = normalizeComuneName(partialName);
	const results: AicsComune[] = [];

	const searchPool = provincia
		? getComuniByProvincia(provincia)
		: AICS_COMUNI;

	for (const comune of searchPool) {
		if (normalizeComuneName(comune.comune).includes(normalized)) {
			results.push(comune);
			if (results.length >= limit) break;
		}
	}

	return results;
}
